import React, { Component } from "react";
import FormField from "./formField";
import formData from "../formData.json";

class Form extends Component {
  constructor() {
    super();
    this.state = {
      form: formData,
    };
  }

  render() {
    const list = this.state.form.map((d) => <li>{this.name}</li>);
    return (
      <div>
        <ul key={list}>{list}</ul>
      </div>
    );
  }
}

export default Form;
